<img src={img} alt="" />

    return (
        <>

        <div className="col-lg-3 col-md-4 col-6 mx-auto">
            <figure className="art_gal">
            <img className="img-fluid" src={props.img} alt="image">
        </img>
            </figure>
        </div>
       
        




        </>
    )
}

export default Art
